script: |
  super -f text -I q9697.spq | sort > q9697.out

inputs:
  - name: q9697.spq
    data: |
      SELECT - col2 FROM tab2 (FORMAT parquet) WHERE NOT + 41 + + col0 * + col2 - + 63 * 50 * col0 NOT BETWEEN + - col1 * + - 48 AND - + col1 + - col1;
  - name: tab2

outputs:
  - name: q9697.out
    data: |
